import { Link, Outlet } from "react-router-dom";

function About() {
  return (
    <div className="about">

      <h2>About the art of Bonsai</h2>
      <p>
        Bonsai is an ancient Japanese practice of producing small trees in
        containers that take the shape of full-scale, mature trees over time.
        The word bonsai translates to "planted in a container." Any tree species
        can be used to grow one, but certain species lend themselves better to
        the practice than others.
      </p>
      <h2>About me</h2>
      <p>I'm an aspiring bonsai cultivator with a passion</p>
      <p>You can view my bonsai collection, or add your own bonsai!</p>
      <Link to="/about/contactme">Click Here to Contact Me!</Link>
      <Link to="/about/FAQs">FAQs</Link>
      <Outlet />
    </div>
  );
}

export default About;
